import React, { Component } from 'react'

export default class Main extends Component {


    clickRequestHandler = () => {
        console.log("HELLO");
    }
    render() {
        return (
            <div>
                <button onClick={this.clickRequestHandler}>
                    Activate Lasers
                </button>
            </div>
        )
    }
}
